// App.js
import React from 'react';
import { Routes ,Route } from 'react-router-dom';import Dashboard from './Dashboard';
import Categories from './Categories';

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path='/' element={<Dashboard/>} />
          <Route path='/categorie' element={<Categories/>} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
